import React from "react";
import "./intro.css";

const Intro = () => {
  return (
    <div className="intro">
        <div className="intro-left">
            <div className="intro-left-wrapper">
                <h2>Hey, my name is</h2>
                <h2 className="intro-name">Jannette</h2>
            </div>
        </div>
        <div className="intro-right">right</div>
    </div>
  )
}

export default Intro
